// NotFound.js
import React from "react";

const Start = () => {
  return (
    <>
    <div class="flex  flex-col justify-center items-center  h-[100vh] ">
  <h1 class="text-[36px] font-bold mb-5 mt-14">Welcome 
  </h1>
  

<div class="flex  ">
<button class="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm  text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 group-hover:from-cyan-500 group-hover:to-blue-500 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800">
<span class="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0">
User
</span>
</button>
  <button onclick="window.location.href='pharmacist/login.html'" type="button" class="text-white bg-gray-800 hover:bg-green-600 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
    صيدلي
  </button>
  
</div>
</div>

    </>
  );
};

export default Start;
